const UPDATE_COLLECTIONS = 'UPDATE_COLLECTIONS';
const FETCH_COLLECTIONS_START = 'FETCH_COLLECTIONS_START';
const FETCH_COLLECTIONS_SUCCESS = 'FETCH_COLLECTIONS_SUCCESS';
const FETCH_COLLECTIONS_FAIL = 'FETCH_COLLECTIONS_FAIL';

const fetchCollectionsStart = () => ({
    type: FETCH_COLLECTIONS_START
});

const updateCollections = collectionsMap => ({
    type: UPDATE_COLLECTIONS,
    collectionsMap
});

export {updateCollections, UPDATE_COLLECTIONS, FETCH_COLLECTIONS_START, FETCH_COLLECTIONS_SUCCESS, FETCH_COLLECTIONS_FAIL};
